Movie Info: Yeh Jawaani Hai Deewani is a 2013 Indian coming-of-age romantic comedy film, directed by Ayan Mukerji and produced by Karan Johar. The film stars Ranbir Kapoor and Deepika Padukone in lead roles. This is their second film together after their 2008 film Bachna Ae Haseeno. Aditya Roy Kapur and Kalki Koechlin play supporting roles. Madhuri Dixit appears in an item number titled &quot;Ghagra&quot; with Ranbir Kapoor in this film. Initially set for a March 2013 release, the film was released on 31 May 2013. Upon release, the film received positive to mixed reviews and was a huge box office success. Yeh Jawaani Hai Deewani has become the fourth highest grossing Bollywood film of all time in India and worldwide. The film is also the seventh highest grossing Bollywood films in overseas markets.


